import React, { useState } from 'react';
import { Formik, Form, Field, FieldArray } from 'formik';
import * as yup from 'yup';
import './media.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import AppHeader from './header';
import Card from 'react-bootstrap/Card';

const schema = yup.object().shape({
  category: yup.string().required('Category is required'),
  tags: yup.string(),
  notes: yup.string(),
  media: yup.array(),
});

const MediaCard = ({ media }) => {
    return (
        <Card style={{ width: '18rem' }}>
          <Card.Body>
            <Card.Title>{media.category}</Card.Title>
            {/* Other media details */}
          </Card.Body>
        </Card>
  );
};

const AppMedia = () => {
    const [mediaEntries, setMediaEntries] = useState([]);
    const [formState, setFormState] = useState('submit');

    const handleSubmit = (values, { resetForm }) => {
        if (formState === 'submit') {
            const newEntry = { ...values };
            setMediaEntries([newEntry, ...mediaEntries]);
            resetForm();
            setFormState('submit');

            // Reset the form state back to 'submit' after a delay
            setTimeout(() => {
              setFormState('submit');
            }, 1); // Change the delay as needed
        }
    };

  const handleEdit = () => {
    setFormState('edit');
  };

  const handleCancel = () => {
    setFormState('cancel');
    document.getElementById('expense-form').reset();
  };

  return (
    <> 
        <AppHeader />
        <div className="media-form-container">
            <div className="media-header">
                <div className="media-text">Upload Your Media</div>
                <div className="underline"></div>
            </div>
            <Formik
                initialValues={{ category: '', tags: '', notes: '', media: [] }}
                validationSchema={schema}
                onSubmit={handleSubmit}
            >
                {({ setFieldValue }) => (
                    <Form id="media-form">
                        <div className="inputs">
                        <div className="input">
                        <Field as="select" name="tripcategory" className="form-control">
                            <option value="">Select Trip Category</option>
                            <option value="business">Business</option>
                            <option value="leisure">Leisure</option>
                            <option value="adventure">Adventure</option>
                            <option value="cultural">Cultural</option>
                            <option value="family">Family</option>
                            <option value="romantic">Romantic</option>
                        </Field>
                            </div>
                            <div className="input">
                                <Field
                                    name="tags"
                                    type="text"
                                    placeholder="Enter tags separated by commas"
                                    className="form-control"
                                />
                            </div>
                            <div className="input">
                                <Field
                                    name="notes"
                                    type="text"
                                    placeholder="Notes"
                                    className="form-control"
                                />
                            </div>
                            <div className="input">
                                <input
                                    id="file"
                                    name="media"
                                    type="file"
                                    multiple
                                    onChange={(event) => {
                                        setFieldValue('media', event.currentTarget.files);
                                    }}
                                    className="form-control"
                                />
                            </div>
                        </div>
                        <div className="media-submit-container">
                            {/* Buttons */}
                        </div>
                    </Form>
                )}
            </Formik>
        </div>
        <div className="media-display">
            {mediaEntries.map((entry, index) => (
                <MediaCard key={index} media={entry} />
            ))}
        </div>
    </>
);
};

export default AppMedia;
